    try{
        const config ={ 
            method: 'get',
            url: 'http://localhost:8080/stocks/51',
        }
        let res=await axios(config)
        let stocks=res.data
        return stocks
    }catch(err){
        console.log(err)
        return false;
    }
}

async function generateRows(){
    try{

        let stocks= await getStocks()
        console.log('Stocks ',stocks)
        let tickers=""
        for(let i=0;i<stocks.length;i++){
            let t=stocks[i].ticker+','
